import axios from "axios";

export async function fetchMaaS360Data() {
  try {
    const response = await axios.get("http://localhost:5000/api/maas360");
    if (response.status !== 200) {
      throw new Error("Error fetching MaaS360 data");
    }
    return response.data.devices;
  } catch (error) {
    throw new Error(`Error fetching MaaS360 data: ${error.message}`);
  }
}
